import React, { useState } from "react";
import s from "./navigation.module.css";
import hamburger from "../../images/svg/icon-hamburger.svg";
import logo from "../../images/svg/logo-bookmark.svg";

export const Navigation = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  return (
    <div>
      <img src={logo}></img>
      <button onClick={openModal}>
        <img src={hamburger} alt="burger"></img>
      </button>
      {isModalOpen && (
        <div>
          <div>jestem tutaj z clicka </div>
          <button onClick={closeModal}>X</button>
        </div>
      )}
    </div>
  );
};
